//// ==============
  render (){
    return (
      <div>
        <nav>
          <button>Home
          </button>
          <button>About SpaceX
          </button>
          <button>About Team
          </button>
        </nav>
      </div>
    )
  }
}

// =============================
// EXPORT
// =============================
export default Nav
